contract EARNPRIVATE is Ownable,ReentrancyGuard {
    using SafeMath for uint256;
    address public walletPool;
    address TokenRecibe;
    address Wallet1;
    address Wallet2;
    uint256 public recolect;
    uint256 public limit;
    uint256 public MaxAmount;
    uint256 public MinAmount;
    uint256 public PercentEarn;
    uint256 private secondPerDay=86400;
    uint256 private TimeDays;    
    bool _lock;
    bool _initialized;
    bool _whiteList;
    mapping(address => Users[]) public balanceUser;
    mapping(address => mapping(uint256 => ThreeDeposits[3])) public depositEarnings;
    mapping(address => uint256) public depositCount;
    mapping(address => bool) public whiteList;

    event DepositMade(address indexed user, uint256 amount, uint256 depositId);
    event WithdrawalMade(address indexed user, uint256 amount, uint256 depositId);
    event earlyClaim(address user, uint256 from, uint256 to);

    struct Users {
        uint256 Amount;
        uint256 initTime;
        uint256 finishTime;
        uint256 Earn;
    }

    struct ThreeDeposits {
        uint256 finishTime;
        uint256 Earn;
        uint256 period;
        bool finished;
    }

        modifier ContractLock() {
        require(!_lock, "Paused Earn");
        _;
    }

    function ChangeWalletRecibe(address _wallet) public onlyOwner {
        walletPool= _wallet;
    }

    function ChangeMinAmount(uint256 _amount) public onlyOwner {
        MinAmount = _amount;
    }

    function ChangeMaxAmount(uint256 _amount) public onlyOwner {
        MaxAmount = _amount;
    }

    function ChangeLimitAmount(uint256 _amount) public onlyOwner {
        limit = _amount;
    }

    function ChangeRecolect(uint256 _recolect) public onlyOwner {
        recolect = _recolect;
    }

    function ChangeDays(uint256 _days) public onlyOwner {
        TimeDays = _days * secondPerDay;
    }

    function ViewDay() public view returns(uint256){
        return TimeDays / secondPerDay;
    }

    function addUserWhiteList(address _wallet) public onlyOwner {
        whiteList[_wallet] = true;
    }

    function addToWhitelist(address[] calldata addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            address addr = addresses[i];
            whiteList[addr] = true;
        }
    }

    function removeFromWhitelist(address[] calldata addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            address addr = addresses[i];
            whiteList[addr] = false;
        }
    }

    function ChangePercent(uint256 _percent) public onlyOwner {
        require(_percent>0,"the number than great 0");
        PercentEarn = _percent;
    }

    //Locks the contract for owner for the amount of time provided
    function lock() external onlyOwner {
        _lock = !_lock;
    }

    constructor(address _walletPool, address _TokenRecibe, bool _whiteListed) {
        walletPool = _walletPool;
        TokenRecibe=_TokenRecibe; 
        _whiteList=_whiteListed;
    }

    function Initialized(uint256 _limit,uint256 _maxAmount, uint256 _minAmount, uint256 _percent,uint256 _days) public onlyOwner{
        require(!_initialized,"Pool has been initialized");
        limit = _limit;
        MaxAmount = _maxAmount;
        MinAmount = _minAmount;
        PercentEarn = _percent;
        TimeDays = _days * secondPerDay;
        _initialized=true;
    }

    function Deposit(uint256 _amount) external nonReentrant ContractLock {
        require(_initialized, "Pool is not initialized");
        require(_amount > 0, "Amount must be greater than zero");
        if (_whiteList) {
            require(whiteList[msg.sender], "You are not in whitelist");
        }
        require(IERC20(TokenRecibe).balanceOf(msg.sender) >= _amount, "Insufficient amount");

        // Create a new deposit
        Users memory userInfo = Users(0, 0, 0, 0);

        userInfo.Amount = _amount;

        require(userInfo.Amount <= MaxAmount, "User limit exceeded");
        require(_amount <= limit, "Pool limit exceeded");
        require(recolect + _amount <= limit, "Pool limit has been reached");

        if (MinAmount > 0) {
            require(_amount >= MinAmount, "Insufficient amount, less than minimum");
        }

        // Calculate the earnings for each time period and store them in the depositEarnings mapping
        uint256 depositId = balanceUser[msg.sender].length;
        uint256 Time = 30;
        uint256 percent = 13;
        for (uint i = 0; i < 3; i++) {
            if(i==2){
                percent=20;
            }
            uint256 earn = userInfo.Amount.mul(percent).div(100);
            depositEarnings[msg.sender][depositId][i] = ThreeDeposits(block.timestamp.add(Time.mul(secondPerDay)),earn,Time,false);
            Time += 30;
        }

        userInfo.finishTime = block.timestamp + TimeDays * 90;
        userInfo.initTime = block.timestamp;

        /// Add the new deposit to the user's array of deposits
        balanceUser[msg.sender].push(userInfo);

        // Emit the DepositMade event
        emit DepositMade(msg.sender, _amount, depositId);

        // Increment the deposit count for the user's wallet
        depositCount[msg.sender]++;        
        recolect += _amount;
        bool success = IERC20(TokenRecibe).transferFrom(msg.sender, walletPool, _amount);
        require(success, "Transfer failed");

    }

    function EarnDeposit(uint256 _depositId,uint256 _lapseTime) external nonReentrant ContractLock {
        require(_initialized, "Pool is not initialized");
        require(balanceUser[msg.sender][_depositId].Amount > 0, "Deposit does not exist");
        Users memory userInfo = balanceUser[msg.sender][_depositId];
        require(userInfo.Amount > 0, "You have already withdrawn your capital and profits");
        ThreeDeposits memory deposits = depositEarnings[msg.sender][_depositId][_lapseTime];
        uint256 amountTransfer = 0;

        if (deposits.period==30 && deposits.finished==false && deposits.finishTime < block.timestamp ) {
            // If exactly 30 days have elapsed, the user can withdraw 13% of their earnings for the first time period
            amountTransfer = deposits.Earn;
            depositEarnings[msg.sender][_depositId][0] = ThreeDeposits(deposits.finishTime,deposits.Earn,0,true);
        } else if (deposits.period==60 && deposits.finished==false && deposits.finishTime < block.timestamp) {
            // If exactly 60 days have elapsed, the user can withdraw 13% of their earnings for the second time period
            amountTransfer = deposits.Earn;
            depositEarnings[msg.sender][_depositId][1] = ThreeDeposits(deposits.finishTime,deposits.Earn,0,true);
        } else if (deposits.period==90 && deposits.finished==false && deposits.finishTime < block.timestamp) {
            // If exactly 90 days have elapsed, the user can withdraw 20% of their earnings for the third time period plus their capital
            amountTransfer = deposits.Earn;
            delete depositEarnings[msg.sender][_depositId];
            delete balanceUser[msg.sender][_depositId];
            recolect = recolect.sub(userInfo.Amount); 
            amountTransfer += userInfo.Amount;
            depositCount[msg.sender]-=1;   
        } else {
            // If not exactly 30, 60 or 90 days have elapsed, the user cannot withdraw anything
            revert("Withdrawal only allowed on day 30, 60 or 90");
        }

        // Emit the WithdrawalMade event
        emit WithdrawalMade(msg.sender, amountTransfer, _depositId);

        bool success = IERC20(TokenRecibe).transfer(msg.sender, amountTransfer);
        require(success, "Transfer failed");

    }

    function RecoverTokens(address _tokens) public onlyOwner{
    	bool success = IERC20(_tokens).transfer(msg.sender, IERC20(_tokens).balanceOf(address(this)));
    	require(success, "Transfer failed");
    }

    function EarlyClaim(address _user, uint256 _depositId, uint256 _period) public onlyOwner {
        // Get the mapping bucket information
        ThreeDeposits memory deposits = depositEarnings[_user][_depositId][_period];
        // Update the deposit completion time
        deposits.finishTime = block.timestamp;
        // Update bucket information in mapping
        depositEarnings[msg.sender][_depositId][_period] = deposits;
        emit earlyClaim(_user, deposits.finishTime, block.timestamp);
    }

    function ChangeDeposit(address _user, uint256 _depositId, uint256 _period, uint256 _finishTime, uint256 _earn, bool _finish) public onlyOwner {
        // Store repository information in mapping
        ThreeDeposits memory deposits = depositEarnings[_user][_depositId][_period];
        depositEarnings[_user][_depositId][_period] = ThreeDeposits(_finishTime,_earn,deposits.period,_finish);
    }
}

